import { __decorate } from "tslib";
import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
let MoviesService = class MoviesService {
    constructor(httpClient) {
        this.httpClient = httpClient;
        this.movieName = '';
        this.url = 'https://localhost:7083/api/v1/moviebooking';
    }
    getAllMovies() {
        return this.httpClient.get(this.url + '/all');
    }
    getMovies(movieName) {
        return this.httpClient.get(this.url + '/search/' + movieName);
    }
    deleteMovie(movieName, theatreName) {
        return this.httpClient.delete(this.url + '/' + movieName + '/delete/' + theatreName, { responseType: 'text' });
    }
    movieDetails(movieName, theatreName) {
        return this.httpClient.get(this.url + '/moviebooking/bookedtickets?movieName=' + movieName + '&theaterName=' + theatreName);
    }
};
MoviesService.ctorParameters = () => [
    { type: HttpClient }
];
